Quando a gente fala em cuidados com a pele no inverno, logo pensamos em redobrar a dose de hidratação, e sim, isso é necessário! Mas também estamos na época ideal para fazer procedimentos dermatológicos que requerem que o paciente evite a exposição ao sol, como peelings (físico, químico ou térmico),

Os peelings são tratamentos que promovem uma renovação de uma ou mais camadas de pele, dependendo do tipo de peeling, haverá uma descamação mais ou menos intensa.

São indicados para tratar: 

•rugas finas;
•poros dilatados;
•manchas superficiais;
•estrias;

